import { MDBCol, MDBFormInline, MDBBtn } from "mdbreact";

export const brandsExplore = (props) => {


    console.log(props.elm.store_image);
    // props.elm.createdAt
    return (

        <Container >
              <br/> 

        <Card style={{ width: '28rem' }} >
         <Image src={props.ele.store_image} /> 
        <Card.Content>
<Card.Header> {props.elm.store_name}</Card.Header>
{/* <Image src={props.ele.store_image}  /> */}

{/* store_image */}
          <Card.Meta>Joined in 2016</Card.Meta>
          <Card.Description>
          {props.elm.store_desc}
          </Card.Description>
        </Card.Content>
        <Card.Content extra> 
        {props.elm.store_website}
          <a>
            <Icon name='user' />
            10 Friends
          </a>
          <MDBBtn  className ="bt"  rounded  gradient="aqua">Aqua</MDBBtn>
           </Card.Content>
       </Card> 
       </Container>
    )
} 
export default brandsExplore
